// components/InfoBanner.jsx
import React from 'react';

const InfoBanner = () => {
  return (
    <div className="bg-blue-50 border-t border-b border-blue-200 px-6 py-2 text-sm text-blue-900">
      We're making it easier to understand your business on homepage. Continue using the new Vendor Central Homepage, or toggle to return. <a href="#" className="text-blue-600 underline">Please leave feedback here.</a>
    </div>
  );
};

export default InfoBanner;
